column784:
26/Apr/24 5:32 PM;thomas.jerke@vodafone.com;Hi,

ILS *with* Hardware is *not* possible. This only works with VVL (Contract Prolongation).

If you book Cover insurance for a subsided (with phone tariff) up to 120 days after last subsidy/contract prolongation the agent must be able to chose between all cover options and look manually for the correct price dependent on the hardware of the customer. The filter of the Cover options only works, if hardware is in shopping cart, which is not possible for ils.;;;

column786:
02/May/24 2:17 PM;thomas.jerke@vodafone.com;Looks like a misunderstanding between ILS/RET.

The 120 days rule is only valid for "Paket ändern" (ILS). In this case VF Cover Insurance can only be booked for existing hardware and this should be not possible after 120 since last contract prolongation.

But in this example a hardware is in shopping cart, so it must be VVL (RET) use case. If a new hardware is selected, then booking of Vodafone Cover should always be possible.;;;

