Multiple things are interesting for this order:
 # Natasa did select VP0 in the checkout, but it is missing from the order.
 ## while testing another bug we noticed that the technician options might not be added to the order when the agent selects them in the dropdown.
 # In the IBP VP0 is added to the order because of the rule "add_VP0_for_ENV_NE4_technician_install_address" which (among other things) checks 
{code:java}
object installation type is technician-install {code}
(which should correspond to the "sehbereitschaft" selected in the OSF checkout)
In contrast to
{code:java}
object availabilities contains self-install {code}
(which should correspond to the address property self-install)

 # If VP0 is not properly added by the dropdown in the checkout as well as not being selected by the rule due to the object installation type not being processed correctly then it might explain why OSF does send WTXN*:
The rule "modem_mapping_for_new_customer_at_selfinstall_address" applies either to

 ## new kip customers that select kip + tv without VP0/1V1

 ## new kip customer without tv

 # The first case would be taken by OSF, thus replacing WTX15 with WTXN15. while the IBP will take neither of them, thus not replacing WTX15

I think the first step must be that OSE must analyse why VP0 is not added to the shopping cart when selecting it in the dropdown.

Additionally no cable product logic seems to be executed after the value in the dropdown is selected for the whole rest of the order process, I was under the impression that at least before the checkout overview the cable product logic should be executed again. It would be nice if this could also be checked.

